function Comp13() {
    function square(num) {
        return num ** 2;
    }
    function cube(num) {
        return num ** 3
    }
    return (
        <div className="comp comp13">
            <h3><span>13</span>&& functions into functions</h3>
            <li>{square(3) + cube(2)}</li>
        </div>
    )
}

export default Comp13;
